height: 44px;
background: #ededed;
padding: 8px 16px;
display:flex;
align-items: center;
`
const Image = styled('img')({
    height: 40,
    width: 40,

})

export const ChatHeader = () => {
  return (
    <Header>
        <Image src={''} alt='dp'/>
        <Box>
            <Typography>Name</Typography>
            <Typography>Online stats</Typography>
        </Box>
        <Box>
            <Search/>
            <MoreVert/>
        </Box>
    </Header>
  )
}
